condition.expression:
(
  (
    (
      NOT(
        (CAST((SUBSTRING(PregnancyDiag, 1, 3)) AS VARCHAR (1000)) IN ('O03', 'O04', 'P95'))
        OR (CAST((SUBSTRING(PregnancyDiag, 1, 4)) AS VARCHAR (1000)) IN ('Z332', 'O021', 'O020', 'O028')))
    )
    OR (
         (
           (CAST((SUBSTRING(PregnancyDiag, 1, 3)) AS VARCHAR (1000)) IN ('O03', 'O04', 'P95'))
           OR (CAST((SUBSTRING(PregnancyDiag, 1, 4)) AS VARCHAR (1000)) IN ('Z332', 'O021', 'O020', 'O028'))
         ) IS NULL
       )
  )
  AND (
        (
          (CAST((SUBSTRING(PregnancyDiag, 1, 3)) AS VARCHAR (1000)) IN ('O03', 'O04', 'P95'))
          OR (CAST((SUBSTRING(PregnancyDiag, 1, 4)) AS VARCHAR (1000)) IN ('Z332', 'O021', 'O020', 'O028'))
        )
        OR (CAST((SUBSTRING(PregnancyDiag, 1, 2)) AS VARCHAR (1000)) IN ('O2'))
      )
)
